class systemConfiguration {
    constructor(object) {
        this.advancedOptionsButton = {};
        this.system = object.system;
        this.systemSelectInput = {};
        this.flow = {};
        this.blackList = {};


        if(typeof object.advancedOptionsButton == "undefined"){
            this.advancedOptionsButton.display = "none";
        } else
        if(typeof object.advancedOptionsButton.display == "undefined"){
            this.advancedOptionsButton.display = "block";
        } else {
            this.advancedOptionsButton.display = object.advancedOptionsButton.display;
        }


        if(typeof object.form == "undefined"){
            this.form = "standard";
        } else
            if(typeof object.form.display == "undefined"){
                this.form = "standard";
        } else {
            this.form = object.form.display;
        }

        if(typeof object.display == "undefined"){
            this.display = "block";
        } else {
            this.display = object.display;
        }

        if(typeof object.systemSelectInput == "undefined"){
            this.systemSelectInput.display = "none";
        } else
        if(typeof object.systemSelectInput.display == "undefined"){
            this.systemSelectInput.display = "none";
        } else {
            this.display = object.display;
        }


        if(typeof object.flow == "undefined"){
            this.flow = {};
            this.flow.display = "block";
        } else
        if(typeof object.flow.display == "undefined"){
            this.flow.display = "block";
        } else {
            this.flow.display = object.flow.display;
        }

        if(typeof object.blackList == "undefined"){
            this.blackList = false;
        } else {
            this.blackList = object.blackList;
        }
    }

}
