function round5(x){ // rounds to the nearest 5.
    return (x % 5) >= 2.5 ? parseInt(x / 5) * 5 + 5 : parseInt(x / 5) * 5;
}
function redirectToFilteredCategory(coolBtuEstimate, heatBtuEstimate, _zipCode, flowSelected) {
    var zone = "";
    var acBTUs = coolBtuEstimate * 6000;
    var btu_zone = Math.floor(acBTUs / 1000);
    var furnaceBTUs = heatBtuEstimate * 1000;
    if (btu_zone >= 50) {
        zone = 60; // Rounding up
        } else
        if (btu_zone < 50 && btu_zone >= 45) {
            zone = 50; // Rounding up
        } else
        if (btu_zone < 45 && btu_zone >= 40) {
            zone = round5(btu_zone)
        } else
        if (btu_zone < 40 && btu_zone >= 35) {
        zone = round5(btu_zone)
        } else
        if (btu_zone < 35 && btu_zone <= 30) {
            zone = 35;
        }

    var area = document.getElementById("squareFeet").value;
    // var system = document.querySelector("#j_systemBlock").value;
    let system = document.querySelector("#j_System").value;


    var response = area * zone;
    checkSize(area, zone, system, response, flowSelected);
}


