function calculateBTU() {
    // var zipCode = $("#zipCode").val();
    var zipCode = document.getElementById("zipCode").value;
    // var area = $("#squareFeet").val();
    var area = document.getElementById("squareFeet").value;
    // var ceilingHeight = $("#ceilingHeight").val();
    var ceilingHeight = document.getElementById("ceilingHeight").value;
    // var sun = parseFloat($("#sun").val());
    var sun = getRadioValue('sunopt')
    var windows = getRadioValue("windowsOpt")
    // var insulation = parseFloat($("#insulation").66.6,juuiio9oo.....o
    var area = parseFloat(document.getElementById("insulation").value);
    var zone = 1.5;
    // var exteriorSeals = parseFloat($("#winDoorInsulation").val());
    var exteriorSeals = parseFloat(document.getElementById("winDoorInsulation").value);
    // var people = parseFloat($("#people").val());
    var people = parseFloat(document.getElementById("people").value);
    var kitchen = getRadioValue("kitchenopt");
    var heatBtuAreaMultiplier = 55 - 8 * zone;
    var coolBtuAreaMultiplier = 17 + zone; // based on zone
    var totalPeople = (people - 2) * 600; //600 per person after 2
    var heightMult = (ceilingHeight - 8) * 0.06; //.06 multiplier per foot of height past 8
    var baseCoolBtu;
    var baseHeatBtu;
    var totalCoolBtu;
    var totalHeatBtu;
    var roundDirection = "no";
    // $(".estimateResult").hide(); // not displaying in HTML at this time, but is capable.
    if (zipLookup[parseInt(zipCode)] == undefined) {
        baseCoolBtu = area * coolBtuAreaMultiplier;
        baseHeatBtu = area * heatBtuAreaMultiplier;
    } else {
        zipCode = document.getElementById("zipCode").value;
        // $("#cityState").text(zipLookup[parseInt(zipCode)].City);
        var cityState = zipLookup[parseInt(zipCode)].City;
        roundDirection = zipLookup[parseInt(zipCode)].Rounding;
        baseCoolBtu = ((zipLookup[parseInt(zipCode)].MaxAvgTemp * 311 - 1500) * area) / 1000;
        baseHeatBtu = (-(zipLookup[parseInt(zipCode)].MinAvgTemp - 82) * 666 * area) / 1000;
    }
    if (advanced) {
        var coolBtuMod = heightMult + insulation + sun + windows + exteriorSeals;
        var heatBtuMod = (heightMult + insulation - sun - windows + exteriorSeals) / 2;

        totalCoolBtu = baseCoolBtu + baseCoolBtu * coolBtuMod + totalPeople + kitchen;
        totalHeatBtu = baseHeatBtu + baseHeatBtu * heatBtuMod - totalPeople - kitchen;
    } else {
        totalCoolBtu = baseCoolBtu;
        totalHeatBtu = baseHeatBtu;
    }
    var coolBtuEstimate;
    if (roundDirection == "up") {
        coolBtuEstimate = Math.max(Math.round((totalCoolBtu + 3000) / 6000), 1);
    } else if (roundDirection == "down") {
        coolBtuEstimate = Math.max(Math.round((totalCoolBtu - 3000) / 6000), 1);
    } else {
        coolBtuEstimate = Math.max(Math.round(totalCoolBtu / 6000), 1);
    }
    var heatBtuEstimate = Math.max(Math.round(totalHeatBtu / 1000), 1);
    var furnaceSize = Math.floor(((heatBtuEstimate * 1000) / 0.8 - 1) / 20000) + 1;
    var heFurnaceSize = Math.floor(((heatBtuEstimate * 1000) / 0.96 - 1) / 20000) + 1;


    // $("#cool_estimate").text("Cooling estimate: ");
    // $("#cool_tonnage").text(coolBtuEstimate / 2 + " Tons");
    // $("#cool_estimate_2").text(" (" + (coolBtuEstimate * 6000).toLocaleString() + " BTU)");
    // $("#heat_estimate").text("Heating estimate: ");
    // $("#heat_btu").text((heatBtuEstimate * 1000).toLocaleString());
    // $("#heat_estimate_2").text(" output BTU");
    // $("#he_furnace_message").text("Recommended Standard 80% AFUE Furnace Size: " + (furnaceSize * 20000).toLocaleString() + " BTU (" + (furnaceSize * 20000 * 0.8).toLocaleString() + " output BTU)");
    // $("#furnace_message").text("Recommended High 96+% AFUE Furnace Size: " + (heFurnaceSize * 20000).toLocaleString() + " BTU (" + (heFurnaceSize * 20000 * 0.96).toLocaleString() + " output BTU)");
    // $(".estimateResult").fadeIn().attr("style", "text-align:center");
    var flowVal = window.flowValue;
    redirectToFilteredCategory(coolBtuEstimate, heatBtuEstimate, zipCode, flowVal);
}

